@Override
public Object clone() {
  CharArrayMap<V> map = null;
  try {
    map = (CharArrayMap<V>)super.clone();
    map.keys = keys.clone();
    map.values = keys.clone();
  } catch (CloneNotSupportedException e) {
    // impossible
  }
  return map;
}

